import React from 'react';
import Home from './Home'
import Login from './Login'
import { Route, Router, Switch } from 'react-router';
function App() {
  return(
    <div className="body">

      <Router>
        <Switch>
          <Route exact path="/">
          <Home/>
          </Route>
          <Route path="/login">
            <Login/>
          </Route>

        </Switch>
      </Router>
    </div>
  );
}
export default App;
